        public static void Activate(bool state)
        {
            if(!isSetup)
            {
                Setup();
            }

            if(state)
            {
                if(!isActive)
                {
                    CineGameSDK.OnPlayerObjectMessage += OnHandleObjectMessage;
                    isActive = true;
                }
            }
            else
            {
                if(isActive)
                {
                    CineGameSDK.OnPlayerObjectMessage -= OnHandleObjectMessage;
                    isActive = false;
                }
            }
        }

        private static void Setup()
        {
            string seatLayout;

            if (Application.isEditor)
            {
                seatLayout = editorSeatLayout;
            }
            else
            {
                seatLayout = Configuration.SEAT_LAYOUT;
            }

            if(string.IsNullOrEmpty(seatLayout))
            {
                return;
            }

            List<RowData> seatRowList = JsonConvert.DeserializeObject<List<RowData>>(seatLayout);

            foreach (RowData row in seatRowList)
            {
                Seat[] newRow = new Seat[row.Data.Count];

                for (int i = 0; i < row.Data.Count; i++)
                {
                    Seat newSeat = null;

                    if (row.Data[i] != null)
                    {
                        Dictionary<string, object> seatInfo = JsonConvert.DeserializeObject<Dictionary<string, object>>(row.Data[i].ToString());
                        newSeat = new Seat();
                        newSeat.Key = "R" + seatInfo["row"].ToString() + "S" + seatInfo["seat"].ToString();
                        newSeat.Row = seatInfo["row"].ToString();
                        newSeat.Column = seatInfo["col"].ToString();
                        newSeat.SeatNumber = seatInfo["seat"].ToString();
                        newSeat.Taken = false;
                        newSeat.Metadata = JsonConvert.DeserializeObject<Dictionary<string, object>>(seatInfo["metadata"].ToString());

                        Seats.Add(newSeat.Key, newSeat);
                    }

                    newRow[i] = newSeat;
                }

                Layout.Add(row.Row, newRow);
            }

            CineGameSDK.OnSeatsLoaded?.Invoke(Layout);
        }

        private void RequestPlayerSeat(int backendID)
        {
            string layoutString = JsonConvert.SerializeObject(Layout);
            byte[] layourByteData = Encoding.ASCII.GetBytes(layoutString);

            string seatsString = JsonConvert.SerializeObject(Seats);
            byte[] seatsByteData = Encoding.ASCII.GetBytes(seatsString);

            CineGameSDK.PlayerObjectMessage dataObj = new CineGameSDK.PlayerObjectMessage();
            dataObj.PutNull("SeatSelect");
            dataObj.PutByteArray("SeatLayout", layourByteData);
            dataObj.PutByteArray("SeatSeats", seatsByteData);
            CineGameSDK.SendObjectMessage(dataObj, backendID);
        }

        public static void OnHandleObjectMessage(int backendID, CineGameSDK.PlayerObjectMessage dataObj)
        {
            if (dataObj.ContainsKey("SeatInput"))
            {
                CineGameSDK.PlayerObjectMessage responseDataObj = new CineGameSDK.PlayerObjectMessage();
                string seatInput = dataObj.GetString("SeatInput");

                if (Seats.TryGetValue(seatInput, out Seat seat))
                {
                    if (seat.Taken)
                    {
                        responseDataObj.PutString("SeatInputResponse", "Taken");
                    }
                    else
                    {
                        responseDataObj.PutString("SeatInputResponse", "Accepted");
                        responseDataObj.PutString("SeatRow", seat.Row);
                        responseDataObj.PutString("SeatNumber", seat.SeatNumber);

                        seat.Taken = true;
                        Seats[seat.Key] = seat;

                        CineGameSDK.OnSeatTaken(backendID, seat);
                    }
                }
                else
                {
                    responseDataObj.PutString("SeatInputResponse", "Rejected");
                }

                CineGameSDK.SendObjectMessage(responseDataObj, backendID);
            }
        }
    }
